import React from 'react'
import { Input, Navbar , Title , User } from './Styled';

function Nav() {
  return (
    <Navbar>
      <Title align='left'>Musicly</Title>
      div<Input></Input>
      <User>John Doe</User>
    </Navbar>
  );
}

export default Nav
